// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./CreditPassport.sol";

/**
 * @title AIVerifier
 * @dev Handles verification of user income data through an oracle pattern
 */
contract AIVerifier is AccessControl {
    bytes32 public constant ORACLE_ROLE = keccak256("ORACLE_ROLE");

    // Reference to the Credit Passport NFT
    CreditPassport public passportNFT;

    // Verification request structure
    struct VerificationRequest {
        address user;
        uint256 requestId;
        string dataReference;
        bool isProcessed;
        uint256 timestamp;
        uint256 verifiedIncome;
    }

    // Mapping from request ID to verification request
    mapping(uint256 => VerificationRequest) private _requests;

    // Counter for request IDs
    uint256 private _requestIdCounter;

    // Income thresholds for rank boosts
    uint256 public bronzeIncomeThreshold = 1000 * 10**6;    // $1,000
    uint256 public silverIncomeThreshold = 5000 * 10**6;    // $5,000
    uint256 public goldIncomeThreshold = 10000 * 10**6;     // $10,000
    uint256 public platinumIncomeThreshold = 25000 * 10**6; // $25,000
    uint256 public diamondIncomeThreshold = 50000 * 10**6;  // $50,000

    // Events
    event VerificationRequested(uint256 indexed requestId, address indexed user, string dataReference);
    event VerificationCompleted(uint256 indexed requestId, address indexed user, uint256 verifiedIncome, bool success);

    constructor(address _passportNFT) {
        passportNFT = CreditPassport(_passportNFT);
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ORACLE_ROLE, msg.sender);
    }

    /**
     * @dev Sets income thresholds for ranks
     */
    function setIncomeThresholds(
        uint256 bronze,
        uint256 silver,
        uint256 gold,
        uint256 platinum,
        uint256 diamond
    ) external onlyRole(DEFAULT_ADMIN_ROLE) {
        bronzeIncomeThreshold = bronze;
        silverIncomeThreshold = silver;
        goldIncomeThreshold = gold;
        platinumIncomeThreshold = platinum;
        diamondIncomeThreshold = diamond;
    }

    /**
     * @dev Requests verification of income data
     * @param dataReference Reference to data (IPFS hash or other identifier)
     */
    function requestVerification(string memory dataReference) external returns (uint256) {
        require(passportNFT.getUserPassport(msg.sender) > 0, "You must have a passport first");

        _requestIdCounter++;

        _requests[_requestIdCounter] = VerificationRequest({
            user: msg.sender,
            requestId: _requestIdCounter,
            dataReference: dataReference,
            isProcessed: false,
            timestamp: block.timestamp,
            verifiedIncome: 0
        });

        emit VerificationRequested(_requestIdCounter, msg.sender, dataReference);

        return _requestIdCounter;
    }

    /**
     * @dev Called by the oracle to fulfill verification requests
     * @param requestId ID of the verification request
     * @param verifiedIncome Verified income amount from analysis
     * @param success Whether the verification was successful
     * @param metadataUri Updated metadata URI for the passport
     */
    function fulfillVerification(
        uint256 requestId,
        uint256 verifiedIncome,
        bool success,
        string memory metadataUri
    ) external onlyRole(ORACLE_ROLE) {
        VerificationRequest storage request = _requests[requestId];
        require(request.user != address(0), "Request does not exist");
        require(!request.isProcessed, "Request already processed");

        request.isProcessed = true;

        if (success) {
            request.verifiedIncome = verifiedIncome;

            // Update the user's passport with the new verified income
            uint256 passportId = passportNFT.getUserPassport(request.user);

            if (passportId > 0) {
                (
                    CreditPassport.Rank currentRank, 
                    uint256 stakeAmount, 
                    uint256 currentIncome
                ) = passportNFT.getPassportInfo(passportId);

                uint256 totalIncome = currentIncome + verifiedIncome;

                // Determine new rank based on total verified income
                CreditPassport.Rank newRank = determineRank(
                    currentRank,
                    stakeAmount,
                    totalIncome
                );

                // Update passport
                passportNFT.updatePassport(
                    passportId, 
                    newRank, 
                    verifiedIncome, 
                    metadataUri
                );
            }
        }

        emit VerificationCompleted(requestId, request.user, verifiedIncome, success);
    }

    /**
     * @dev Determines rank based on stake amount and income
     * @param currentRank Current rank of the passport
     * @param stakeAmount Amount staked
     * @param totalIncome Total verified income
     * @return newRank The new rank
     */
    function determineRank(
        CreditPassport.Rank currentRank,
        uint256 stakeAmount,
        uint256 totalIncome
    ) public view returns (CreditPassport.Rank) {
        // The basic principle: rank can increase based on either stake or income
        // but never decrease

        // Determine rank based on income
        CreditPassport.Rank incomeRank;
        if (totalIncome >= diamondIncomeThreshold) {
            incomeRank = CreditPassport.Rank.DIAMOND;
        } else if (totalIncome >= platinumIncomeThreshold) {
            incomeRank = CreditPassport.Rank.PLATINUM;
        } else if (totalIncome >= goldIncomeThreshold) {
            incomeRank = CreditPassport.Rank.GOLD;
        } else if (totalIncome >= silverIncomeThreshold) {
            incomeRank = CreditPassport.Rank.SILVER;
        } else if (totalIncome >= bronzeIncomeThreshold) {
            incomeRank = CreditPassport.Rank.BRONZE;
        } else {
            incomeRank = CreditPassport.Rank.NONE;
        }

        // Return the highest rank between current, income-based, and stake-based
        if (uint(currentRank) >= uint(incomeRank)) {
            return currentRank; // Keep current rank if it's higher
        } else {
            return incomeRank; // Otherwise use income-based rank
        }
    }

    /**
     * @dev Gets details of a verification request
     * @param requestId ID of the verification request
     */
    function getRequestDetails(uint256 requestId) external view returns (
        address user,
        string memory dataReference,
        bool isProcessed,
        uint256 timestamp,
        uint256 verifiedIncome
    ) {
        VerificationRequest storage request = _requests[requestId];
        require(request.user != address(0), "Request does not exist");

        return (
            request.user,
            request.dataReference,
            request.isProcessed,
            request.timestamp,
            request.verifiedIncome
        );
    }
}

contracts/CreditPassport.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title CreditPassport
 * @dev NFT representing a user's financial identity and rank
 */
contract CreditPassport is ERC721URIStorage, AccessControl, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // Rank system instead of numerical credit score
    enum Rank { NONE, BRONZE, SILVER, GOLD, PLATINUM, DIAMOND }

    // Role for minting and updating passports
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    // Mapping from token ID to rank
    mapping(uint256 => Rank) private _passportRanks;

    // Mapping from token ID to total verified income
    mapping(uint256 => uint256) private _verifiedIncomes;

    // Mapping from user address to token ID
    mapping(address => uint256) private _userPassports;

    // Mapping from token ID to original stake amount
    mapping(uint256 => uint256) private _stakeAmounts;

    // Mapping to track if token ID exists
    mapping(uint256 => bool) private _tokenExists;

    // Emitted when a credit passport is updated
    event PassportUpdated(uint256 indexed tokenId, Rank newRank, uint256 newTotalIncome);

    constructor() ERC721("Credit Passport", "CPASS") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _transferOwnership(msg.sender);
    }

    /**
     * @dev Creates a new credit passport
     * @param user Address of the passport owner
     * @param initialRank Initial rank
     * @param stakeAmount Amount of USDC staked
     * @param initialIncome Initial verified income amount
     * @param uri Metadata URI for the NFT
     * @return tokenId The ID of the newly created passport
     */
    function createPassport(
        address user,
        Rank initialRank,
        uint256 stakeAmount,
        uint256 initialIncome,
        string memory uri
    ) public onlyRole(MINTER_ROLE) returns (uint256) {
        require(_userPassports[user] == 0, "User already has a credit passport");

        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _mint(user, newTokenId);
        _setTokenURI(newTokenId, uri);

        _passportRanks[newTokenId] = initialRank;
        _stakeAmounts[newTokenId] = stakeAmount;
        _verifiedIncomes[newTokenId] = initialIncome;
        _userPassports[user] = newTokenId;
        _tokenExists[newTokenId] = true;

        emit PassportUpdated(newTokenId, initialRank, initialIncome);

        return newTokenId;
    }

    /**
     * @dev Updates an existing credit passport with new verified income and rank
     * @param tokenId ID of the passport to update
     * @param newRank Updated rank
     * @param additionalIncome Additional verified income to add
     * @param newUri Updated metadata URI
     */
    function updatePassport(
        uint256 tokenId,
        Rank newRank,
        uint256 additionalIncome,
        string memory newUri
    ) public onlyRole(MINTER_ROLE) {
        require(_tokenExists[tokenId], "Passport does not exist");

        _passportRanks[tokenId] = newRank;
        _verifiedIncomes[tokenId] += additionalIncome;
        _setTokenURI(tokenId, newUri);

        emit PassportUpdated(tokenId, newRank, _verifiedIncomes[tokenId]);
    }

    /**
     * @dev Returns passport information
     * @param tokenId ID of the passport
     * @return rank Current rank
     * @return stakeAmount Original stake amount
     * @return verifiedIncome Total verified income
     */
    function getPassportInfo(uint256 tokenId) public view returns (
        Rank rank, 
        uint256 stakeAmount, 
        uint256 verifiedIncome
    ) {
        require(_tokenExists[tokenId], "Passport does not exist");
        return (
            _passportRanks[tokenId], 
            _stakeAmounts[tokenId], 
            _verifiedIncomes[tokenId]
        );
    }

    /**
     * @dev Returns a user's passport token ID
     * @param user Address of the user
     * @return tokenId User's passport token ID (0 if none exists)
     */
    function getUserPassport(address user) public view returns (uint256) {
        return _userPassports[user];
    }

    /**
     * @dev Returns the rank of a passport
     * @param tokenId ID of the passport
     * @return rank Passport rank
     */
    function getPassportRank(uint256 tokenId) public view returns (Rank) {
        require(_tokenExists[tokenId], "Passport does not exist");
        return _passportRanks[tokenId];
    }

    /**
     * @dev Returns rank as a string
     * @param rank The rank enum value
     * @return rankStr The rank as a string
     */
    function rankToString(Rank rank) public pure returns (string memory) {
        if (rank == Rank.BRONZE) return "BRONZE";
        if (rank == Rank.SILVER) return "SILVER";
        if (rank == Rank.GOLD) return "GOLD";
        if (rank == Rank.PLATINUM) return "PLATINUM";
        if (rank == Rank.DIAMOND) return "DIAMOND";
        return "NONE";
    }

    /**
     * @dev Required override for OpenZeppelin contracts
     */
    function supportsInterface(bytes4 interfaceId) public view override(ERC721, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

